import React, { Component } from 'react'
import './List.css'
import Item from '../Item/Item'

export default class List extends Component {
    render() {
        let {toDos} = this.props;

        return (
            <div>
                {
                    toDos.map(item => {
                        return <Item {...item}/>
                    })
                }
            </div>
        )
    }
}
